
-- Create tables
CREATE TABLE freelancers (
    freelancer_id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    email VARCHAR(100) UNIQUE NOT NULL,
    phone VARCHAR(15),
    skills TEXT,
    rating FLOAT CHECK (rating >= 0 AND rating <= 5),
    hourly_rate FLOAT,
    profile_description TEXT
);

CREATE TABLE clients (
    client_id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    email VARCHAR(100) UNIQUE NOT NULL,
    phone VARCHAR(15),
    company VARCHAR(100),
    profile_description TEXT
);

CREATE TABLE proposals (
    proposal_id INT AUTO_INCREMENT PRIMARY KEY,
    freelancer_id INT,
    client_id INT,
    project_title VARCHAR(100) NOT NULL,
    description TEXT,
    bid_amount FLOAT,
    submission_date DATE,
    status ENUM('submitted', 'accepted', 'rejected') NOT NULL,
    FOREIGN KEY (freelancer_id) REFERENCES freelancers(freelancer_id),
    FOREIGN KEY (client_id) REFERENCES clients(client_id)
);

CREATE TABLE reviews (
    review_id INT AUTO_INCREMENT PRIMARY KEY,
    freelancer_id INT,
    client_id INT,
    rating INT CHECK (rating >= 1 AND rating <= 5),
    comment TEXT,
    review_date DATE,
    FOREIGN KEY (freelancer_id) REFERENCES freelancers(freelancer_id),
    FOREIGN KEY (client_id) REFERENCES clients(client_id)
);

CREATE TABLE transactions (
    transaction_id INT AUTO_INCREMENT PRIMARY KEY,
    freelancer_id INT,
    client_id INT,
    amount FLOAT,
    transaction_date DATE,
    payment_method ENUM('credit_card', 'bank_transfer', 'paypal'),
    FOREIGN KEY (freelancer_id) REFERENCES freelancers(freelancer_id),
    FOREIGN KEY (client_id) REFERENCES clients(client_id)
);

